import React from "react"
import postlist from './posts.json'
import { makeStyles } from '@material-ui/styles'
import { Box, CardContent, Card, Typography } from '@material-ui/core'
import Markdown from "markdown-to-jsx"

const PostList = () => {

    const useStyles = makeStyles({
        container: {
        },
        cardPost: {
          borderRadius: '2px',
        },
        headerText: {
          fontWeight: "bolder"
        },
        headerLink: {
          textDecoration: "none",
          color: "black"
        },
      })
    
    const classes = useStyles();

    return (
        <div className="postlist">
        {postlist.length &&
        postlist.map((post, i) => {
            return (
                <Box>
                    <Card>
                        <CardContent className={classes.cardPost}>
                        <Typography className={classes.headerText} variant="h3">{post.title}</Typography>
                        <Markdown>{post.content}</Markdown>
                        </CardContent>
                    </Card>
                </Box>
            )
        })}
        </div>
    )
}

export {PostList}
